import React from 'react'

const InviteTable = () => {
  let friendList= null;
  return (
    <div className='competition-container'>
      <ul className='collection'>
        <li className='collection-header'>
          <h3>Invite Friends?</h3>
        </li>
        {friendList}
        <p className='lrb-border'/>
      </ul>
    </div>
  )
}

export default InviteTable
